import React from 'react';
import './pageStyles.css';

function ContactUs() {
  const handleButtonClick = () => {
    const sendButton = document.querySelector('.contact-box button');
    sendButton.classList.add('shake');
    setTimeout(() => {
      sendButton.classList.remove('shake');
    }, 300);
  };

  return (
    <>
      <div className='container'>
        <div className='contact-box'>
          <form method='POST'>
            <input type='text' name='Name' value="" placeholder='Enter your Full Name'></input>
            <input type='text' name='Email' value="" placeholder='Enter your Email'></input>
            <input type='text' name='Subject' value="" placeholder='Subject of Message'></input>
            <textarea value="" name='Message' placeholder='Your Message'></textarea>
            <button onClick={handleButtonClick}>Send</button>
          </form>
        </div>
      </div>
    </>
  );
}

export default ContactUs;
